CREATE TABLE IF NOT EXISTS "attendancefpcheck_app_entreprise" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "raison_sociale" varchar(100) NOT NULL, "heure_normale_arrivee" time NOT NULL, "heure_normale_depart" time NOT NULL, "duree_horaire_normale" integer unsigned NOT NULL CHECK ("duree_horaire_normale" >= 0));
