CREATE TABLE IF NOT EXISTS "attendancefpcheck_app_empreinte" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "type_empreinte" varchar(20) NOT NULL, "minutie" varchar(250) NOT NULL, "chemin_image" varchar(100) NOT NULL, "lecteur_id" integer NOT NULL REFERENCES "attendancefpcheck_app_lecteur" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "attendancefpcheck_app_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "attendancefpcheck_app_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
